import React from "react";
import ResultsList from "./ResultsList";

const ResultsListContainer = () => {
  return (
    <View>
      <ResultsList locationName="Compassion Meals" distance="2.0 mi" />
      <ResultsList locationName="Compassion Meals" distance="2.0 mi" />
    </View>
  );
};

export default ResultsListContainer;
